import React from "react";

import { Drawer, DrawerItem } from "../../../components/Drawer";

const Navigation = ({ route }) => {
  return (
    <Drawer onChange={console.log}>
      <DrawerItem name="apple"  icon="apple"   />
      <DrawerItem name="apple1" icon="apple"  />
      <DrawerItem name="apple2" icon="apple"  />
      <DrawerItem name="apple3" icon="apple"  />
      <DrawerItem name="apple4" icon="apple"  />
      <DrawerItem name="apple5" icon="apple"  />
      <DrawerItem name="apple6" icon="apple"  />
      <DrawerItem name="apple7" icon="apple"  />
    </Drawer>
  );
};

export default Navigation;
